  false,\n\t\"url\": null,\n\t\"notes\": \"The objectives of this Master Cooperative
  Wildland Fire Management Agreement are to provide a basis for cooperation among
  the agencies on all aspects of wildland fire management, and in all-hazard emergency
  support function activities as requested and authorized under the Robert T. Stafford
  Disaster Relief and Emergency Assistance Act, and to facilitate the exchange of
  personnel, equipment (including aircraft), supplies, services, and funds among the
  agencies.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
